var map;
var markers = [];
var a = -1;

function initMap() {
  const directionsService = new google.maps.DirectionsService();
  const directionsRenderer = new google.maps.DirectionsRenderer();
  const geocoder = new google.maps.Geocoder();
  map = new google.maps.Map(document.getElementById('map'), {
    zoom: 20, 
    center: {lat: 24.43124869755053, lng: 118.31364050408477},
    zoomControl: false,    
    scaleControl: true,
    fullscreenControl: false,
    mapTypeControl: true,
    mapTypeControlOptions: {
      style: google.maps.MapTypeControlStyle.HORIZONTAL_BAR,
      position: google.maps.ControlPosition.LEFT_BOTTOM,},
    gestureHandling: "greedy",
    
  });
  const trafficLayer = new google.maps.TrafficLayer();
  trafficLayer.setMap(map);
  

  directionsRenderer.setMap(map);
  directionsRenderer.setPanel(document.getElementById("bottom-panel"));
    
  const onChangeHandler = function () {
    calculateAndDisplayRoute(directionsService, directionsRenderer);
  };
  document.getElementById("start").addEventListener("change", onChangeHandler);
  document.getElementById("combobox").addEventListener("change", onChangeHandler);
  
  for (var i = 0; i <position.length; i++) {
    addMarker(i);  
  };
  

  
  
  
  
  
}

function addMarker(e) {
  markers[e] = new google.maps.Marker({
    position: {
      lat: position[e].LAT,
      lng: position[e].LNG
    },
    icon:{
      url:"https://github.com/biglan-1234/googlemap/blob/master/roadlight.png?raw=true",
      scaledSize: new google.maps.Size(30, 30),
      labelOrigin:new google.maps.Point(50,-10),
               },    
    map: map,
    
  });
  var infowindow = new google.maps.InfoWindow({
   content: '路燈編號: '+position[e].路燈編號+'<br>'+
            position[e].區域+'<br>'+
            position[e].地址+'<br>'+
           '設立方式: '+position[e].設立方式+'<br>'+
           '經度: '+position[e].LNG+'<br>'+
           '緯度: '+position[e].LAT,
    position: {
      lat: position[e].LAT,
      lng: position[e].LNG
    },
    
  });
 
  
   markers[e].addListener('click',function(){
    a = a * -1;
    if(a > 0){
      infowindow.open(map, markers[e]);
    }else{
      infowindow.close();
    }
  });
  
 map.addListener('zoom_changed',function(){
    var zoom = map.getZoom();
    if (zoom >= 20) {
       markers[e].setVisible(true);
       }
     else {                           
       markers[e].setVisible(false);
       }
    }
  )
 
  
  
  
}



function calculateAndDisplayRoute(directionsService, directionsRenderer) {
  directionsService.route(
    {
      origin: {
        query: document.getElementById("start").value,
      },
      destination: {
        query: document.getElementById("combobox").value,
      },
      travelMode: google.maps.TravelMode.DRIVING,
      provideRouteAlternatives:true,
    },
    (response, status) => {
      if (status === "OK") {
        directionsRenderer.setDirections(response);
      } else {
        window.alert("Directions request failed due to " + status);
      }
    }
  );
}
